(20, '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc rhoncus elit in est commodo hendrerit. In sodales rhoncus tincidunt. Integer iaculis nisi sit amet risus malesuada vulputate. Sed diam orci, cursus ut luctus sit amet.</p>\r\n\r\n<p><a class="btn btn-default" href="#">Buy Now</a></p>\r\n', 'About Consilium - Left sidebar', 'filtered_html'),
(21, '<div class="container">\r\n<p>[row][col class="col-lg-5 col-md-5 col-sm-5 col-xs-12"]</p>\r\n\r\n<h3>Fully Responsive</h3>\r\n\r\n<p>Built using the powerful Bootstrap framework, Consilium is mobile ready right from the start.</p>\r\n\r\n<p>View your website perfectly across all devices and screen sizes. If preferred this can easily be turned off in the options panel.</p>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla vulputate quam pellentesque neque aliquet, in interdum leo tempus. Donec tincidunt at ligula sed vulputate. Nunc vel enim interdum, ultricies massa id, pretium erat. Praesent ut nisl ornare, hendrerit lectus in, tristique ligula.&nbsp;</p>\r\n\r\n<p>Duis vitae laoreet felis. Morbi enim turpis, consectetur non dignissim condimentum, rhoncus eu elit. Aenean vel tempus risus. Vestibulum ornare, turpis eu suscipit volutpat, lacus turpis ornare sapien, et cursus odio nulla ut lacus. Phasellus non ante tempor, vehicula libero eu, accumsan dui.&nbsp;</p>\r\n\r\n<p>[/col]</p>\r\n\r\n<p>[col class="col-lg-7 col-md-7 col-sm-7 col-xs-12"]<img alt="" src="/superhero/consilium/sites/default/files/fullyresponsive_consilium.png" />[/col][/row]</p>\r\n</div>\r\n', 'Features - Fully Responsive', 'full_html'),
(22, '<div class="container">\r\n<p>[row][col class="col-lg-6 col-md-6 col-sm-6 col-xs-12"]<img alt="" src="/superhero/consilium/sites/default/files/pagebuilder.png" style="width: 538px; height: 301px;" /><span style="line-height: 1.6em;">[/col]</span><span style="line-height: 1.6em;">[col class="col-lg-6 col-md-6 col-sm-6 col-xs-12"]</span></p>\r\n\r\n<h3>Drag and Drop Page Builder</h3>\r\n\r\n<p>Built using the powerful Bootstrap framework, Consilium is mobile ready right from the start.</p>\r\n\r\n<p>View your website perfectly across all devices and screen sizes. If preferred this can easily be turned off in the options panel.</p>\r\n\r\n<p>[/col][/row]</p>\r\n</div>\r\n', 'Features - Drag and Drop Page Builder', 'full_html'),
(23, '<div class="container">\r\n<p>[row][col class="col-lg-4 col-md-4 col-sm-4 col-xs-12"]<img alt="" src="/superhero/consilium/sites/default/files/animations.png" style="font-size: 13px; line-height: 1.6em; width: 307px; height: 227px;" /><span style="font-size: 13px; line-height: 1.6em;">[/col]</span></p>\r\n\r\n<p>[col class="col-lg-8 col-md-8 col-sm-8 col-xs-12"]</p>\r\n\r\n<h3>Animations on any block</h3>\r\n\r\n<p>With Consilium you can add animations on any block</p>\r\n\r\n<p><span style="line-height: 1.6em;">Built using the Superhero Framework Block module. All block configuration forms provide the ability to add animation effects which will trigger when the user views the block on the page.</span></p>\r\n\r\n<p>[/col][/row]</p>\r\n</div>\r\n', 'Features - Animations', 'full_html'),
(24, '<h1 class="rtecenter"><span style="font-size:48px; font-family:''open_sansbold'';"><span style="color: rgb(255, 255, 255);">Parallax Sections</span></span></h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p class="rtecenter" style="font-size:24px; line-height:32px; color:#ffffff;">With Consilium you can add unlimited parallax sections where<br />\r\never you want using full width blocks</p>\r\n', 'Features - Parallax Sections', 'full_html'),
(25, '<p style="margin: 0px; font-size: 38px; line-height: 45px; font-family: open_sanslight; text-align: center; color: rgb(0, 0, 0);">THE FURTHER YOU LOOK</p>\r\n\r\n<p style="margin: 0px; font-size: 48px; line-height: 57px; font-family: open_sanslight; text-align: center; color: rgb(0, 0, 0);">THE BETTER IT GETS</p>\r\n\r\n<p style="margin: 0px; font-size: 21px; line-height: 25px; font-family: open_sanslight; text-align: center; color: rgb(0, 0, 0);">Keep scrolling down this page and be amazed</p>\r\n', 'Animation page parallax', 'full_html'),
(26, '<ul class="list">\r\n	<li>Responsive Template</li>\r\n	<li>Easy Installs</li>\r\n	<li>Fully Customizable</li>\r\n	<li>8 Preset Color Options</li>\r\n	<li>JoomlaMan Extensions Included</li>\r\n	<li>Bootstrap &amp; Helix Framework</li>\r\n</ul>\r\n', 'Check list', 'full_html'),
